import React, { useState, useEffect } from 'react';
import _Redux from '../Store/_Redux';

const FetchAllGenresOfMovies = props => {

    return (
        <React.Fragment>
            <_Redux FetchType="FETCH_TRENDING" url='/trending/all/week?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US'/>
            {/* <_Redux FetchType="FETCH_HORROW" url='/top_rated?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US'/> */}
            <_Redux FetchType="FETCH_HORROW" typeOf="movie" url='/discover/movie?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US&with_genres=10749'/>
            {/* <_Redux FetchType="FETCH_HORROW" url='/discover/tv?api_key=028e8ea4ca7d9164d085c9238979098b&language=en-US&with_networks=213'/> */}
        </React.Fragment>
    )
}

export default FetchAllGenresOfMovies;
